import React from 'react';
import { Container } from 'react-bootstrap';
import { HashLink } from 'react-router-hash-link';
import { Link } from 'react-router-dom';
import MenuBackgroundImage from '../../assets/images/menu-background.jpg';
// import ReactWOW, {animation} from 'react-wow';

const Navigationpage = (props) => {

    const onClickHandler = (menuName) => {
        props.openNavMenuHandler();
    };

    return (
        <div className="offcanvas_menu d-block ic_mobile_nav_head" style={{backgroundImage: 'url(' +MenuBackgroundImage+ ')'}}>
      
        <Container className="ic-container">
            <div className="ic-mobile-menu-wrapper">
                <div id="menu" className="mobile-menu">
                    <ul className="ic-mobile-menu">
                    <li>
                        {/* <HashLink smooth to="/#home" onClick={() => onClickHandler()}> */}
                        <Link smooth to="/" onClick={() => onClickHandler()}>
                        Home
                        </Link>
                    </li>
                    
                    <li>
                        <Link smooth to="/" onClick={() => onClickHandler()}>
                        About
                        </Link>
                    </li>
                    
                    <li>
                        <Link
                        smooth
                        to="/"
                        onClick={() => onClickHandler()}
                        >
                        Services
                        </Link>
                    </li>
                    
                    <li>
                        <Link smooth to="/" onClick={() => onClickHandler()}>
                        Works
                        </Link>
                    </li>
                    
                    <li>
                        <Link
                        smooth
                        to="/#contact"
                        onClick={() => onClickHandler()}
                        >
                        Contact
                        </Link>
                    </li>
                    
                    </ul>
                </div>
            </div>
        </Container>
    </div>
    )
};

export default Navigationpage;
